import React from "react"

const styling = {
    width: "100 vw",
    height: "100 vh",
    frameBorder: "0"
}

function Header() {
    return (
        <header>
            <h1>Hola, Mundo!</h1>
            <input type={"button"} value="See my work!" />
            <iframe src="https://giphy.com/embed/BHNfhgU63qrks" title="giph" style={styling} className="giphy-embed" allowFullScreen></iframe><p><a href="https://giphy.com/gifs/BHNfhgU63qrks">via GIPHY</a></p>
        </header>
    )
}

export {Header}
